(8, 8, 'Lab Aid-2', '<p>Closed: Friday &amp; other Govt. holidays are closed.</p>\r\n', 'ল্যাব এইড-২', '<p>বন্ধঃ শুক্রবার ও অন্যান্য সরকারি ছুটির দিন বন্ধ।&nbsp;</p>\r\n', 'N/A ', 'N/A ', '8 AM - 9 AM', 'সকাল ৮ টা - সকাল ৯ টা ', '', '', '12:00:00', '18:00:00', 10, 'sdfds', '2018-10-01 20:01:47', '2018-11-01 10:04:06'),
(8, 10, 'Lab Aid-3', '<p>Visiting Hour: Evening</p>\r\n\r\n<p>Working Day: Monday-Wednesday.&nbsp;</p>\r\n\r\n<p>Closed: Friday &amp; other Govt. holidays are closed.</p>\r\n', 'ল্যাব এইড-৩', '<p>সাক্ষাতের সময়ঃ বিকাল</p>\r\n\r\n<p>কার্য দিবসঃ সোমবার-বুধবার।</p>\r\n\r\n<p>বন্ধঃ শুক্রবার ও অন্যান্য সরকারি ছুটির দিন বন্ধ।</p>\r\n', 'N/A ', 'N/A ', '8 AM - 9 AM ', 'সকাল ৮ টা - সকাল ৯ টা ', '<p>Come directly to the serial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#ff0000\">N.B:&nbsp;বিশেষ কারণে ৩০-১০-২০১৮ইং তারিখ হইতে ০৭-১১-২০১৮ইং চেম্বারে বসবেন না।&nbsp;</span></p>\r\n', '<p>সরাসরি এসে সিরিয়াল দিতে হয়।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#ff0000\">বিঃদ্রঃ বিশেষ কারণে ৩০-১০-২০১৮ইং তারিখ হইতে ০৭-১১-২০১৮ইং চেম্বারে বসবেন না।&nbsp;</span></p>\r\n', '00:00:00', '00:00:00', 0, '', '2018-10-29 18:41:49', '2018-11-01 12:19:18');

